import { ContactInfo } from './partner-screen-components/contact-info';
import { PersonalInfo } from './partner-screen-components/personal-info';
import { PartnerTypeForm } from './partner-screen-components/partner-type-form';

export const PartnerScreen : FC = () => {

return(
    <>
    <PartnerTypeForm/>
